oved to <a target=”_blank” href="%1$s">a dedicated extension</a>. <b><a target=”_blank” href="%2$s">Learn more about this change</a></b>'=>'⚠️ API REST i dikurshëm i WooCommerce-it është kaluar në <a target=”_blank” href="%1$s">zgjerim enkas</a>. <b><a target=”_blank” href="%2$s">Mësoni më tepër rreth këtij ndryshimi</a></b>','The WooCommerce Legacy REST API plugin running on this site.'=>'API REST Legacy WooCommerce xhiron në këtë sajt.','Your subscription for <strong>%1$s</strong> expired. <a href="%3$s">%4$s</a> to continue receiving updates and streamlined support.'=>'Pajtimi juaj për <strong>%1$s</strong> ka skaduar. Që të vazhdoni të merrni përditësime dhe asistencë më afër problemit, <a href="%3$s">%4$s</a>.','Renew for %1$s'=>'Rinovim për %1$s','<a href=\'%s\'>More information</a>'=>'<a href=\'%s\'>Më tepër hollësi</a>','for %s '=>'për %s ','ℹ️️ The WooCommerce Legacy REST API extension is installed and active.'=>'ℹ️️ Zgjerimi API REST i dikurshëm i WooCommerce-it është i instaluar dhe aktiv.','The legacy REST API is NOT enabled'=>'API REST Legacy NUK është e aktivizuar','The legacy REST API is enabled'=>'API REST Legacy është i aktivizuar',' Your subscription expires on %1$s, <a href="%2$s" class="woocommerce-enable-autorenew">enable auto-renew</a> to continue receiving updates.'=>' Pajtimi jua skadon më %1$s, që të vazhdoni të merrni përditësime, <a href="%2$s" class="woocommerce-enable-autorenew">aktivizoni vetërinovimin</a>.',' Your subscription expired, <a href="%1$s" class="woocommerce-renew-subscription">renew %2$s</a>to update.'=>' Pajtimi jua ka skaduar, që të përditësohet, <a href="%1$s" class="woocommerce-enable-autorenew">rinovoni %2$s</a>.','This webhook has the ⚠️ symbol in front of its name in the list below. Please either edit the webhook to use a different delivery format, or install and activate <a href="%s" target="_blank">the WooCommerce Legacy REST API extension</a>.'=>'Ky <em>webhook</em> ka simbolin ⚠️ para emrit të tij në listën më poshtë. Ju lutemi, ose përpunoni webhook-un që të përdorë një tjetër format dërgimi, ose instaloni dhe aktivizoni <a href="%s" target="_blank">zgjerimin API REST WooCommerce i Dikurshëm</a>.' . "\0" . 'Këta webhook-ë kanë simbolin ⚠️ para emrit të tyre në listën më poshtë. Ju lutemi, ose përpunoni webhook-ët që të përdorin një tjetër format dërgimi, ose instaloni dhe aktivizoni <a href="%s" target="_blank">zgjerimin API REST WooCommerce i Dikurshëm</a>.','There\'s %d webhook that is configured to be delivered using the Legacy REST API, which has been removed from WooCommerce. This webhook will fail to be sent.'=>'Ka %d <em>webhook</em> që është formësuar të jepet duke përdorur API-n REST të Dikurshëm, e cila është hequr nga WooCommerce-i. Dërgimi i këtij webhook-u do të dështojë.' . "\0" . 'Ka %d webhook-ë që janë formësuar të jepen duke përdorur API-n REST të Dikurshëm, e cila është hequr nga WooCommerce-i. Dërgimi i këtyre webhook-ëve do të dështojë.','Incompatible webhooks warning'=>'Sinjalizim për Webhook-ë të papërputhshëm','This webhook is configured to be delivered using the Legacy REST API, but the Legacy REST API plugin is not installed on this site.'=>'Ky <em>webhook</em> që është formësuar të jepet duke përdorur API-n REST të Dikurshëm, por shtojca API-n REST i Dikurshëm s’është e instaluar në këtë sajt.','block titleTotals'=>'Gjithsej','block titleComing Soon'=>'S’afërmi','block descriptionShows the subtotal, fees, discounts, shipping and taxes.'=>'Bën shfaqjen e nënshumave, tarifave, zbritjeve në çmimm, dërgim dhe taksa.','Store coming soon'=>'Shitorja vjen së shpjeti','⚠ <b><a target="_blank" href="%s">The Legacy REST API</a> is active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ <b><a target="_blank" href="%s">API REST e Dikurshme</a> është aktive në këtë sajt.</b> Ju lutemi, kini parasysh se API REST i Dikurshëm WooCommerce <b>nuk</b> është i përputhshëm me HPOS.','⚠ <b><a target="_blank" href="%s">The Legacy REST API plugin</a> is installed and active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ <b><a target="_blank" href="%s">API REST e Dikurshme</a> është e instaluar dhe aktive në këtë sajt.</b> Ju lutemi, kini parasysh se API REST i Dikurshëm WooCommerce <b>nuk</b> është i përputhshëm me HPOS.','Track inventory'=>'Ndiqni inventarin','⚠️ The file system connection could not be initialized.'=>'⚠️ S’u nis dot lidhja me sistem kartelash.','You may want to switch to the database for log storage.'=>'Mund të doni të kaloni te baza e të dhënave për depozitim regjistrash.','⚠️ The file system is not configured for direct writes. This could cause problems for the logger.'=>'⚠️ Sistemi i kartelave s’është formësuar për shkrim të drejtpërdrejtë. Kjo mund të shkaktojë probleme për regjistruesin.','Data in posts table appears to be more recent than in HPOS tables. Compare order data with `wp wc hpos diff %1$d` and use `wp wc hpos backfill %1$d --from=posts --to=hpos` to fix.'=>'Të dhëna në tabelë postimesh duken të jenë më të freskëta se ato në tabela HPOS. Krahasojini të dhënat e porosisë me urdhrin `wp wc hpos diff %1$d` dhe përdorni `wp wc hpos backfill %1$d --from=posts --to=hpos` për ndreqje.','Attribution'=>'Atribuim','Template namePage: Coming soon'=>'Faqe: Së shpejti','Select your shipping options'=>'Përzgjidhni mundësitë tuaja për dërgime','Great things are on the horizon'=>'Gjëra të lezetshme po shfaqen në horizont','Name of credit cardCartes Bancaires'=>'Cartes Bancaires','✅ Ready'=>'✅ Gati','Cleanup completed for %d order. Review errors above.'=>'Pastrim i plotësuar për %d porosi. Shqyrtoni gabimet më sipër.' . "\0" . 'Pastrim i plotësuar për %d porosi. Shqyrtoni gabimet më sipër.','Failed to clean up all orders in a batch. Aborting.'=>'S’u arrit të pastrohen krejt porositë njëherësh. Po ndërpritet.','Hide shipping costs until an address is entered (Not available when using 