		','Order attribution information.'=>'Hollësi atributi porosie.','<a id="woo-connect-notice-url" href="%s">Connect your store</a> to WooCommerce.com to get updates and streamlined support for your subscriptions.'=>'<a id="woo-connect-notice-url" href="%s">Lidheni shitoren tuaj</a> me WooCommerce.com-in, që të merrni për pajtimet tuaja përditësime dhe asistencë të përimtuar.','Something big is brewing! Our store is in the works and will be launching soon!'=>'Diçka e madhe po zien! Shitorja jonë është duke u bërë gati dhe do vihet në punë së shpejti!',' <a href="%1$s" class="woocommerce-connect-your-store">Connect your store</a> to woocommerce.com to update.'=>' Që të përditësohet, <a href="%1$s" class="woocommerce-connect-your-store">lidhni shitoren tuaj</a> me woocommerce.com-in.','There was an error processing your order. Please check for any charges in your payment method and review your <a href="%s">order history</a> before placing the order again.'=>'Pati një gabim me përpunimin e porosisë tuaj. Ju lutemi, kontrolloni për çfarëdo tarifash të aplikuara nga metoda juaj e pagesave dhe shqyrtoni <a href="%s">historikun e porosive</a> tuaja, para se të ribëni porosinë.','block descriptionThe product custom fields.'=>'Fushat vetjake për produktin.','block titleProduct custom fields control'=>'Kontroll fushash vetjake për produktin','block keywordfields'=>'fusha','block keywordcustom'=>'vetjake','block keywordselect'=>'përzgjidhni','block descriptionA select field for use in the product editor.'=>'Një fushë përzgjedhje për ta përdorur te përpunuesi i produkteve.','block titleProduct select field'=>'Fushë përzgjedhjeje produktesh','block descriptionThe product custom fields toggle.'=>'Butoni për fusha vetjake produkti.','block titleProduct custom fields toggle control'=>'Kontroll butoni për fusha vetjake produkti','Site visibility'=>'Dukshmëri sajti','Live'=>'Drejtpërdrejt','Approving will share credentials with %s. Do not proceed if this looks suspicious in any way.'=>'Miratimi do të sjellë dhënie kredencialesh te %s. Mos vazhdoni më tej, nëse kjo duket e dyshimtë nga çfarëdo këndvështrimi.','Plugin installed by %1$s on %2$s.'=>'Shtojcë e instaluar nga %1$s më %2$s.','Plugin installed by %1$s on %2$s. <a target="_blank" href="%3$s">More information</a>'=>'Shtojcë e instaluar nga %1$s më %2$s. <a target="_blank" href="%3$s">Më tepër informacion</a>','Enter an optional note attached to the order confirmation message sent to the shopper.'=>'Jepni një shënim opsional, bashkëngjitur mesazhit të ripohimit të porosisë dërguar blerësit.','Post-purchase note'=>'Shënim për pas blerjesh','Custom fields'=>'Fusha vetjake','Show custom fields'=>'Shfaq fusha vetjake','Custom fields can be used in a variety of ways, such as sharing more detailed product information, showing more input fields, or for internal inventory organization. %1$sRead more about custom fields%2$s'=>'Fushat vetjake mund të përdoren në një larmi mënyrash, fjala vjen, për të dhënë informacion më të hollësishëm produkti, për të shfaqur më tepër fusha dhëniesh, ose për sistem inventari të brendshëm. %1$sLexoni më tepër rreth fushash vetjake%2$s','Use global attributes to allow shoppers to filter and search for this product. Use custom attributes to provide detailed product information.'=>'Përdorni atribute globalë, për t’u lejuar blerësve të filtrojnë dhe të kërkojnë për këtë produkt. Përdorni atribute vetjake për të dhënë informacion të hollësishëm produkti.','Per your %1$sstore settings%2$s, taxes are not enabled.'=>'Sipasr %1$srregullimeve të shitores%2$s tuaj, taksat s’janë të aktivizuara.','Unable to create backup post for order %d.'=>'S’arrihet të krijohet postim kopjeruajtje për porosinë %d.','%s is not a valid order property.'=>'%s s’është veti e vlefshme porosie.' . "\0" . '%s s’janë veti të vlefshme porosie.','%s is an internal meta key. Use --props to set it.'=>'%s është një tast i brendshëm meta. Për ta ujdisur, përdorni --props.' . "\0" . '%s janë taste të brendshëm meta. Për t’i ujdisur, përdorni --props.','The backup datastore does not support updating orders.'=>'Depozita e të dhënave të kopjeruajtjeve nuk mbulon përditësim porosish.','New custom field name'=>'Emër fushe të re vetjake','Please review the errors above.'=>'Ju lutemi, shqyrtoni gabimet më sipër.','WooCommerce Blocks development mode requires files to be built. From the root directory, run %1$s to ensure your node version is aligned, run %2$s to install dependencies, %3$s to build the files or %4$s to build the files and watch for changes.'=>'Mënyra zhvillim për Blloqe WooCommerce lyp të montohen kartela. Që nga drejtoria rrënjë, xhironi %1$s që të garantohet se versioni i nyjës tuaj është ai që duhet, xhironi %2$s, që të instalohen varësitë, %3$s që të montohen kartelat, ose %4$s që të montohen kartelat dhe të vëzhgohet për ndryshime.','Overriding existing data with an already registered key is not allowed'=>'Nuk lejohet mbishkrimi i të dhënave ekzistuese me një kyç tashmë të regjistruar','Set up your payment methods and accept credit and debit cards, cash, bank transfers and money from your Mercado Pago account. Offer safe and secure payments with Latin America’s leading processor.'=>'Ujdisni metoda pagesash dhe pranoni karta krediti dhe debiti, urdhërpagesa dhe para nga llogaria juaj Mercado Pago. Offroni pagesa të parrezik dhe të siguruara përmes shërbimit kryesues të Amerikës Latine.','The metaboxhidden_product meta from the user metas.'=>'Elementi meta metaboxhidden_product për elementë meta përdoruesish.','Key for the data being registered must be a string'=>'Kyçi për të dhënat që po regjistrohen duhet të jetë një varg','Mercado Pago'=>'Mercado Pago','Collect sales tax'=>'Mblidhni taksa shitjesh','Add your products'=>'Shtoni produkte tuajt','Get paid'=>'Përfitoni pagesa','Grow your business'=>'Fuqizoni biznesin tuaj','It\'s time to celebrate – you\'re ready to launch your store! Woo! Hit the button to preview your store and make it public.'=>'Erdhi koha të festoni – jeni gati të vini në funksionim shitoren tuaj! Urra! Shtypni butonin, që të bëni paraparje të shitores tuaj dhe për ta vënë në punë.','Launch your store'=>'Bëni publike shitoren tuaj','Get your products shipped'=>'Dërgoni produktet tuaja','Current price is: %s.'=>'Çmimi i tanishëm është: %s.','Original price was: %s.'=>'Çmimi origjinal qe: %s.','Checkout can be customized <a href="%s">in the Editor</a> with your active theme.'=>'Hapi i përfundimit të blerjes mund të përshtatet <a href="%s">te Përpunuesi</a> me temën tuaj aktive.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce-i u rrek të instalonte <a href="%1$s">shtojcën Legacy REST API</a>, ngaqë ky sajt ka <a href="%2$s">të aktivizuar Legacy REST API</a>, ose ka <a href="%3$s">të përkufizuar webhook-e të dikurshëm</a>, por instalimi dështoi (shihni hollësi gabimesh te <a href="%4$s">regjistrat e WooCommerce-it</a>). Ju lutemi, instalojeni dhe aktivizojeni shtojcën dorazi. <a href="%5$s">Më tepër hollësi</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'ℹ️ WooCommerce-i instaloi dhe aktivizoi <a href="%1$s">shtojcën API REST e Dikurshme</a>, ngaqë ky sajt ka <a href="%2$s">të aktivizuar shtojcën API REST e Dikurshme</a>, ose ka <a href="%3$s">të përkufizuar webhook-e të dikurshëm</a>. <a href="%4$s">Më tepër informacion</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce instaloi shtojcën për API REST të dikurshëm, por s’arriti ta aktivizojë, për më tepër hollësi, shihni konteksin.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce instaloi <a href="%1$s">shtojcën për API REST të dikurshëm</a>, ngaqë ky sajt ka <a href="%2$s">shtojcën për API REST të dikurshëm të aktivizuar</a>, ose ka <a href="%3$s">të përkufizuar webhook-e të dikurshëm</a>, por s’arriti ta aktivizojë (shihni hollësi gabimesh te <a href="%4$s">regjistra WooCommerce-i</a>). Ju lutemi, kaloni te <a href="%5$s">faqja e shtojcave</a> dhe aktivizojeni dorazi. <a href="%6$s">Më tepër hollësi</a>','Please enter a valid email at checkout to use coupon code "%s".'=>'Që të përdoret kod kuponi “%s”, ju lutemi, jepni një email të vlefshëm gjatë përfundimit të blerjes.','Please enter a valid email to use coupon code "%s".'=>'Që të përdoret kod kuponi “%s”, ju lutemi, jepni një email të vlefshëm.','To allow logging, make %s writable.'=>'Që të lejoni regjistrime, bëjeni %s të shkrueshme.','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Marrje vendore: Ujdisni vendndodhje marrjesh vendore, që nga <a href="%s">faqja e rregullimeve për Marrje vendore</a>.','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pickup settings page</a>.'=>'Eksploroni te <a href="%s">faqja e rregullimeve për Marrje vendore</a> një metodë të re të thelluar dërgimi, e cila ju lejon t’u ofroni klientëve tuaj një, ose më tepër vendndodhje marrjeje vendore.','Gathering usage data allows us to tailor your store setup experience, offer more relevant content, and help make WooCommerce better for everyone.'=>'Mbledhja e të dhënave të përdorimit na lejon t’ju përshtatim funksionimin e ujdisjes së shitores, t’ju ofrojmë lëndë më me peshë dhe të ndihmojmë të bëhet WooCommerce-i më i mirë për këdo.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download</a> and install it manually.'=>'Që të vazhdoni të merrni përditësime dhe asistencë të thjeshtuar, pjesë e pajtimeve tuaja WooCommerce.com, ju lutemi, <a href="%1$s">Instaloni Përgjegjësin WooCommerce.com të Përditësimeve</a>. Ndryshe, mund ta <a href="%2$s">shkarkoni</a> dhe instaloni dorazi.','Please <a href="%1$s">activate the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions.'=>'Që të vazhdoni të merrni përditësime dhe asistencë të thjeshtuar, pjesë e pajtimeve tuaja WooCommerce.com, ju lutemi, <a href="%1$s">aktivizoni Përgjegjësin WooCommerce.com të Përditësimeve</a>.',' Activate WooCommerce.com Update Manager to update.'=>' Që të përditësohet, aktivizoni Përgjegjës WooCommerce.com Përditësimesh.',' <a href="%1$s">Install WooCommerce.com Update Manager</a> to update.'=>' Që të përditësohet, <a href="%1$s">instaloni Përgjegjës WooCommerce.com Përditësimesh</a>.','block keywordrich-text'=>'tekst-i-pasur','block keywordtextarea'=>'zonë_teksti','block descriptionA text-area field for use in the product editor.'=>'Një fushë tekst për t’u përdorur te përpunuesi i produkteve.','block titleProduct textarea block'=>'Bllok fushe teksti produkti','block descriptionThe product subsection description.'=>'Përshkrimi i nën-ndarjes së produktit.','block titleProduct subsection description'=>'Përshkrim nën-ndarjeje produkti','block keywordsubsection'=>'nënndarje','Invalid %s provided.'=>'U dha %s e pavlefshme.','Internal server error'=>'Gabim i brendshëm shërbyesi','Sorry, you cannot delete resources.'=>'Na ndjeni, s’mund të fshini burime.','Sorry, you cannot create resources.'=>'Na ndjeni, s’mund të krijoni burime.','Sorry, you cannot view resources.'=>'Na ndjeni, s’mund të shihni burime.','True to force the creation of a new receipt even if one already exists and has not expired yet.'=>'“True”, për të detyruar krijimin e një recete të re, edhe kur ekziston tashmë një e tillë dhe s’ka skaduar ende.','Number of days to be added to the current date to get the expiration date.'=>'Numër ditësh për t’u shtuar te data e tanishme, për të arritur te data e skadimit.','Expiration date formatted as yyyy-mm-dd.'=>'Datë skadimi e formatuar si vvvv-mm-dd.','Expiration date of the receipt, formatted as yyyy-mm-dd.'=>'Datë skadimi e faturës, e formatuar si vvvv-mm-dd.','Public url of the receipt.'=>'URL publike e faturës.','Unique identifier of the order.'=>'Identifikues unik i porosisë.','Order not found'=>'S’u gjet porosi','Receipt not found'=>'S’u gjet faturë','Account Type'=>'Lloj Llogarie','Application Name'=>'Emër Aplikacioni','Payment method'=>'Metodë pagese','Date Paid'=>'Datë Pagimi','Amount Paid'=>'Sasi e Paguar','Discount (%s)'=>'Zbritje (%s)','Summary: Order #%d'=>'Përmbledhje: Porosi #%d','Receipt'=>'Faturë','Receipt from %s'=>'Faturë nga %s','Background process for coupon meta conversion stopped'=>'U ndal proces në prapaskenë për shndërrim meta kuponi','Background process for coupon meta conversion not started, nothing done.'=>'S’u nis proces në prapaskenë për shndërrim meta kuponi, s’u bë gjë.','Background process for coupon meta conversion started'=>'U nis proces në prapaskenë për shndërrim meta kuponi','Background process for coupon meta conversion already started, nothing done.'=>'Proces në prapaskenë për shndërrim meta kuponi tashmë i nisur, s’u bë gjë.','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently %d entries that can be converted.'=>'Kjo do të shndërrojë zëra meta <code>coupon_data</code> objekti porosie në zëra të thjeshtuar <code>coupon_info</code>. Shndërrimi do të ndodhë në prapaskenë, me kohë ekstra (përmes Planifikuesit të Veprimeve). Aktualisht ka %d zëra që mund të shndërrohen.','Convert order coupon data to the simplified format'=>'Shndërro në formatin e thjeshtuar të dhëna kuponësh porosish','This will stop the background process that converts <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. There are currently %d entries that can be converted.'=>'Kjo do të ndalë procesin në sfond që shndërron zëra meta <code>coupon_data</code> objekti porosie në zëra të thjeshtuar <code>coupon_info</code>. Aktualisht ka %d zëra që mund të shndërrohen.','Stop converting'=>'Resht së shndërruari','Stop converting order coupon data to the simplified format'=>'Resht së shndërruari në formatin e thjeshtuar të dhëna kuponësh porosish','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently no entries to convert.'=>'Kjo do të shndërrojë zëra meta <code>coupon_data</code> objekti porosie në zëra të thjeshtuar <code>coupon_info</code>. Shndërrimi do të ndodhë në prapaskenë, me kohë ekstra (përmes Planifikuesit të Veprimeve). Aktualisht s’ka zëra që mund të shndërrohen.','AID'=>'AID','Start converting'=>'Fillo të shndërrosh','Start converting order coupon data to the simplified format'=>'Fillo të shndërrosh në formatin e thjeshtuar të dhëna kuponësh porosish','A font family with slug "%s" already exists.'=>'Ka tashmë një familje shkronjash me identifikuesin “%s”.','The font family preview is required.'=>'Paraparja e familjes së shkronjave është e domosdoshme.','The font family name is required.'=>'Emri i familjes së shkronjash është i domosdoshëm.','Sorry, you are not allowed to upload this file type.'=>'Na ndjeni, s’keni leje të ngarkoni këtë lloj kartelash.','%d is not an order or has an invalid order type.'=>'%d s’është porosi, ose ka një lloj të pavlefshëm porosie.','Order legacy data cleanup process has been started.'=>'Filloi procesi i spastrimit të të dhënave në format të dikurshëm të porosive.','No orders in need of cleanup'=>'S’ka porosi për t’u spastruar','Order legacy data cleanup has been canceled.'=>'Procesi i spastrimit të të dhënave në format të dikurshëm të porosive u anulua.','Clearing data...'=>'Po spastrohen të dhëna…','Clear data'=>'Spastro të dhënat','This tool will clear the data from legacy order tables in WooCommerce.'=>'Ky mjet do të spastrojë të dhëna nga tabela të dikurshme porosish në WooCommerce.','Clean up order data from legacy tables'=>'Spastro të dhëna porosish nga tabela të dikurshme','Order legacy cleanup failed for an entire batch of orders. Aborting cleanup.'=>'Spastrimi i porosive të dikurshme dështoi për një grup të tërë porosish. Po ndërpritet spastrimi.','Order %1$d legacy data could not be cleaned up during batch process. Error: %2$s'=>'Të dhëna të dikurshme porosie %1$d s’u spastruan dot gjatë procesit për grupin. Gabim: %2$s','Directory size: %s'=>'Madhësi drejtorie: %s','The %s hook has a filter set, so some log files may have different retention settings.'=>'Për grremçin %s ka të ujdisur një filtër, ndaj disa kartela regjistri mund të kenë rregullime të tjera mbajtjeje.','Please use different source (--from) and destination (--to) datastores.'=>'Ju lutemi, përdorni depozitime të ndryshme të dhënash për burimin (--from) dhe vendmbërritjen (--to).','\'%s\' is not a valid datastore.'=>'“%s” s’është depozitë e vlefshme të dhënash.','Please provide a valid order ID.'=>'Ju lutemi, jepni një ID porosie të vlefshme.','Checkbox: %s'=>'Kutizë: %s','Next image'=>'Figura pasuese','Previous image'=>'Figura e mëparshme','Close Product Gallery dialog'=>'Mbylleni dialogun e Galerisë së Produkteve','Page Loaded.'=>'Faqja u Ngarkua.','The font face src is required.'=>'Burimi për <em>font face</em> është i domosdoshëm.','The font face weight is required.'=>'Trashësia për <em>font face</em> është e domosdoshme.','The font face font style is required.'=>'Stili për <em>font face</em> është i domosdoshëm.','The font face family name is required.'=>'Emri i familjes për <em>font face</em> është i domosdoshëm.','A font face with slug "%s" already exists.'=>'Ka tashmë një identifikues <em>font face</em>-i “%s”.','Font Face installation error: %s'=>'Gabim instalimi <em>Font Face</em>: %s','Loading page, please wait.'=>'Faqja po ngarkohet, ju lutemi, pritni.','The image upload failed: "%s", creating the product without image'=>'Ngarkimi i figurës dështoi: “%s”, po krijohet produkti pa figurë','Invalid plugin slug provided in the plugins activated rule.'=>'U dha identifikues i pavlefshëm shtojce te rregull të aktivizuar shtojcash.','The size of the log directory.'=>'Madhësia e drejtorisë së regjistrave.','Minimum severity level.'=>'Shkallë minimum rëndësie.','The number of days log entries are retained.'=>'Numri i ditëve sa mbahen zëra regjistri.','The logging handler class.'=>'Klasë trajtuesi regjistrimi.','Logging.'=>'Regjistrim.','Whether the coupon grants free shipping or not.'=>'Nëse jep apo jo kuponi dërgim falas.','Discount amount as defined in the coupon (absolute value or a percent, depending on the discount type).'=>'Vlerë zbritjeje, siç përkufizohet te kuponi (vlerë absolute, ose në përqindje, në varësi të llojit të zbritjes).','Discount type.'=>'Lloj zbritjeje çmimi.','The total size of the files in the log directory.'=>'Madhësia gjithsej e kartelave te drejtoria e regjistrave.','Log directory size'=>'Madhësi drejtorie regjistrash','The minimum severity level of logs that will be stored.'=>'Shkalla minimum e rëndësisë së regjistrave që duhen ruajtur.','How many days log entries will be kept before being auto-deleted.'=>'Sa ditë të mbahen zëra regjistrash, para se të fshihen në mënyrë të automatizuar.','How log entries are being stored.'=>'Si depozitohen zëra regjistrash.','Handler'=>'Trajtues','Is logging enabled?'=>'A është aktivizuar regjistrimi?','Logging'=>'Regjistrim','Create and save'=>'Krijoje dhe ruaje','Casablanca'=>'Kazablankë','block titleProduct Gallery (Beta)'=>'Galeri Produktesh (Beta)','block descriptionDisplay the list of additional field values from the current order.'=>'Shfaqni listën e vlerave të fushave shtesë prej porosisë së tanishme.','block titleAdditional Field List'=>'Listë Fushash Shtesë','block titleAdditional Fields'=>'Fusha Shtesë','block titleAdditional information'=>'Informacion shtesë','block descriptionThe product details section description.'=>'Përshkrimi i ndarjes për hollësi produkti.','block titleProduct details section description'=>'Përshkrim ndarjeje për hollësi produktit','block keywordlist'=>'listë','block keywordlinked'=>'e lidhur','block descriptionThe linked product list.'=>'Lista e lidhur e produkteve.','block titleLinked product list'=>'Lista e lidhur e produkteve','block descriptionRender additional fields in the \'Additional information\' location.'=>'Vizatoni fusha shtesë te vendndodhja “Informacion shtesë”.','block descriptionDisplay additional checkout fields from the \'contact\' and \'order\' locations.'=>'Shfaqni fusha shtesë përfundimi blerjeje nga vendndodhjet “kontakt” dhe “porosi”.','Un-schedule'=>'Hiqi planifikimin','Remove the currently scheduled action to delete expired transient files. Expired files won\'t be automatically deleted until the \'Schedule expired transient files cleanup\' tool is run again.'=>'Që të fshihen kartela kalimtare të skaduara, hiqni veprimin aktual të planifikuar. Kartelat e skaduara s’do të fshihen automatikisht, deri sa mjeti “Planifikoni spastrim kartelash kalimtare të skaduara”.','Re-schedule'=>'Riplanifikojeni','Tip: By suggesting complementary products in the cart using cross-sells, you can significantly increase the average order value.'=>'Ndihmëz: Duke sugjeruar produkte plotësuese te shporta, përmes përdorimit të “cross-sells”, mund të shtoni dukshëm vlerën mesatare të porosisë.','Un-schedule expired transient files cleanup'=>'Hiqni planifikim spastrim kartelash kalimtare të skaduara','Schedule the action to delete expired transient files for running immediately. Subsequent actions will run once every 24h.'=>'Caktoni xhirim të menjëhershëm të veprimit për fshirje kartela kalimtare të skaduara. Veprimet pasuese do të kryhen çdo 24 orë.','Remove the currently scheduled action to delete expired transient files, then schedule it again for running immediately. Subsequent actions will run once every 24h.'=>'Që të fshihen kartela kalimtare të skaduara, hiqni veprimin aktual të planifikuar, mandej rivëreni në plan për xhirim të menjëhershëm. Veprimet pasuese do të kryhen çdo 24 orë.','Schedule expired transient files cleanup'=>'Planifikoni spastrim kartelash kalimtare të skaduara','Re-schedule expired transient files cleanup'=>'Riplanifikoni spastrim kartelash kalimtare të skaduara','By suggesting complementary products in the cart using cross-sells, you can significantly increase the average order value. %1$sLearn more about linked products%2$s'=>'Duke sugjeruar produkte plotësuese te shporta, përmes përdorimit të “cross-sells”, mund të shtoni dukshëm vlerën mesatare të porosisë. %1$sMësoni më tepër rreth produktesh të lidhur%2$s','Medium'=>'E mesme','Tip: Upsells are products that are extra profitable or better quality or more expensive. Experiment with combinations to boost sales.'=>'Ndihmëz: “Upsells” janë produkte që janë tejet me fitim, ose me cilësi më të mirë, ose më të shtrenjtë. Eksperimentoni me këto kombinime, që t’u jepni një shtytje shitjeve.','Include downloads'=>'Përfshi shkarkime','Linked products'=>'Produkte të lidhur','Customer Email'=>'Email Klienti','You do not have permission to manage logging settings.'=>'S’keni leje të administroni rregullime regjistrimi.','Database settings'=>'Rregullime baze të dhënash','File system settings'=>'Rregullime sistemi kartelash','⚠️ This directory does not appear to be writable.'=>'⚠️ Kjo drejtori s’duket të jetë e shkrueshme.','Log files are stored in this directory: %s'=>'Kartelat regjistër depozitohen në këtë drejtori: %s','Log entries are stored in this database table: %s'=>'Zëra regjistrash depozitohen në këtë tabelë të bazës së të dhënave: %s','Unable to start synchronization. The link you followed may have expired.'=>'S’arrihet të niset njëkohësimi. Lidhja që ndoqët mund të ketë skaduar.','Upsells are typically products that are extra profitable or better quality or more expensive. Experiment with combinations to boost sales. %1$sLearn more about linked products%2$s'=>'“Upsells” zakonisht janë produkte tipike që janë më me fitim, ose me cilësi më të mirë, ose më të shtrenjtë. Eksperimentoni me këto kombinime, që t’u jepni një shtytje shitjeve. %1$sMësoni më tepër rreth produktesh të lidhur%2$s','Level threshold'=>'Prag niveli','Retention period'=>'Periudhë mbajtjeje','Log storage'=>'Depozitë regjistrash','Database (not recommended on live sites)'=>'Bazë të dhënash (jo e rekomanduar për sajte në funksionim)','File system (default)'=>'Sistem kartelash (parazgjedhje)','Logger'=>'Regjistrues','Logs settings'=>'Rregullime regjistrash','Differences found for order %d:'=>'U gjetën ndryshime për porosinë %d:','No differences found.'=>'S’u gjetën ndryshime.','An error occurred while computing a diff for order %1$d: %2$s'=>'Ndodhi një gabim teksa realizohej një <em>diff</em> për porosinë %1$d: %2$s','This sets the minimum severity level of logs that will be stored. Lower severity levels will be ignored. "None" means all logs will be stored.'=>'Kjo cakton shkallën minimum të rëndësisë së regjistrave që duhet ruajtur. Shkallë më të ulëta rëndësie do të shpërfillen. “None” do të thotë se do të ruhen krejt regjistrat.','This setting cannot be changed here because it is defined in the %1$s constant, probably in your %2$s file.'=>'Ky rregullim s’mund të ndryshohet këtu, ngaqë është përcaktuar te konstantja %1$s, sipas gjasave në kartelën tuaj %2$s.','This setting cannot be changed here because it is being set by a filter on the %s hook.'=>'Ky rregullim s’mund të ndryshohet këtu, ngaqë është përcaktuar nga një filtër mbi grremçin %s.','This determines where log entries are saved.'=>'Kjo përcakton se ku të ruhen zëra regjistrash.','This setting cannot be changed here because it is defined in the %s constant.'=>'Ky rregullim s’mund të ndryshohet këtu, ngaqë është përcaktuar te konstantja %s.','Note that if this setting is changed, any log entries that have already been recorded will remain stored in their current location, but will not migrate.'=>'Kini parasysh se nëse ndryshohet ky rregullim, çfarëdo zërash regjistrash që janë regjistruar tashmë do të mbeten të depozituar në vendin e tyre të tanishëm, por s’do të migrohen.','Logging is disabled. It can be enabled in <a href="%s">Logs Settings</a>.'=>'Regjistrimi është i çaktivizuar. Mund të aktivizohet te <a href="%s">Rregullime Regjistrimi</a>.','%1$s log file from source %2$s was deleted.'=>'U fshi %1$s kartelë regjistër nga burimi %2$s.' . "\0" . 'U fshinë %1$s kartela regjistër nga burimi %2$s.','Orders subject to cleanup: %d'=>'Porosi subjekt spastrimi: %d','Unsynced orders: %d'=>'Porosi të panjëkohësuara: %d','Compatibility mode enabled?: %s'=>'A është e aktivizuar mënyra përputhshmëri?: %s','HPOS enabled?: %s'=>'A është i aktivizuar HPOS-i?: %s','Minimal'=>'Minimal','A link to a product sold on a different website, e.g. brand collab.'=>'Një lidhje për te produkti i shitur në një sajt tjetër, p.sh., nga bashkëpunim markash.','A set of products that go well together, e.g. camera kit.'=>'Një grup produktesh që shkojnë me njëri-tjetrin, p.sh. një paketë kamere.','A single physical or virtual product, e.g. a t-shirt or an eBook.'=>'Një produkt njësh, material, ose virtual, p.sh., një bluzë, ose një e-libër.','This sets how many days log entries will be kept before being auto-deleted.'=>'Kjo cakton sa ditë të mbahen zëra regjistrash, para se të fshihen në mënyrë të automatizuar.','Affiliate product'=>'Produkt i afërt','Airwallex Payments'=>'Pagesa Airwallex','Boost international sales and save on FX fees. Accept 60+ local payment methods including Apple Pay and Google Pay.'=>'Jepuni një shtytje shitjeve ndërkombëtare dhe kurseni në tarifa FX. Pranoni mbi 60 metoda pagesash, përfshi Apple Pay dhe Google Pay.','Coupons for groups. Provides the option to have coupons that are restricted to group members or roles. Works with the free Groups plugin.'=>'Kuponë për grupe. Jep mundësinë të kihen kuponë që janë të kufizuar për anëtarë ose role grupi. Funksionon me shtojcën falas “Grupe”.','Give away a free item to any customer with the coupon code.'=>'Jepini cilitdo klienti një artikull falas, përmes kodi kuponi.','Create "store credit" coupons for customers which are redeemable at checkout.'=>'Krijoni për klientët kuponë “kredit për në shitore”, që mund të përdoren gjatë përfundimit të blerjes.','Create a unique URL that applies a discount and optionally adds one or more products to the customer\'s cart.'=>'Krijoni një URL unike që aplikon një ulje çmimi dhe, në daçi, shton një ose disa produkte te shporta e klientit.','Powerful, "all in one" solution for gift certificates, store credits, discount coupons and vouchers.'=>'Zgjidhje e fuqishme, “all in one”, për dëshmi dhuratash, kredit në shitore, kuponë zbritjesh në çmim dhe “vouchers”.','Integrate your WooCommerce store with 5000+ cloud apps and services today. Trusted by 11,000+ users.'=>'Integrojeni sot shitoren tuaj WooCommerce me mbi 5000 aplikacione në re dhe shërbime. Besuar nga mbi 11 mijë përdorues.','Turn your product images into stunning videos that engage and convert audiences - no video experience required.'