ownloadable files in the browser, instead of saving them to the device.'=>'Hapni te shfletuesi kartela të shkarkueshme, në vend të ruajtjes së tyre te pajisja.','Open in browser'=>'Hape në shfletues','Summarize this product in 1-2 short sentences. We’ll show it at the top of the page.'=>'Jepni një përmbledhje të këtij produkti me 1 a 2 fjali të shkurtra. Do ta shfaqim në krye të faqes.','Are you sure you want to disconnect your store from WooCommerce.com?'=>'Jeni i sigurt se doni të shkëputni shitoren tuaj nga WooCommerce.com?','Your store is not connected to WooCommerce.com. Run `wp wc com connect` command.'=>'Shitorja juaj s’është e lidhur me WooCommerce.com. Jepni urdhrin `wp wc com connect`.','Describe this product. What makes it unique? What are its most important features?'=>'Përshkruajeni këtë produkt. Ç’e bën unik? Cilat janë veçoritë e tij më të rëndësishme?','Product types define available product details and attributes, such as downloadable files and variations. They’re also used for analytics and inventory management.'=>'Llojet e produkteve përcaktojnë hollësi dhe atribute të produkteve, bie fjala, kartela të shkarkueshme, apo variante. Ato përdoren gjithashtu te statistikat dhe për administrim inventari.','<b>Variable –</b> a product with variations, each of which may have a different SKU, price, stock option, etc. For example, a t-shirt available in different colors and/or sizes.'=>'<b>I ndryshueshëm –</b> një produkt me variante, ku secili prej tyre mund të ketë SKU, çmim, mundësi stoku, etj të ndryshëm. Për shembull, një bluzë mund të jetë në ngjyra dhe/ose madhësi të ndryshme.','<b>External or Affiliate –</b> one that you list and describe on your website but is sold elsewhere.'=>'<b>I jashtëm ose Partner –</b> një që e paraqisni dhe e përshkruani në sajtin tuaj, por që shitet gjetkë.','<b>Grouped –</b> a collection of related products that can be purchased individually and only consist of simple products. For example, a set of six drinking glasses.