ritni shpejtësinë dhe sigurinë, me %1$sJetpack%2$s','Get automated sales tax with %1$sWooCommerce Tax%2$s'=>'Përfitoni automatizim taksash shitjeje, me %1$sWooCommerce Tax%2$s','Print shipping labels with %1$sWooCommerce Shipping%2$s'=>'Shtypni etiketa dërgimi, me %1$sWooCommerce Shipping%2$s','%1$1sExplore our docs%2$2s for more information, or just get started!'=>'%1$1sEksploroni dokumentimin tonë%2$2s, për më tepër hollësi, ose thjesht fillojani!','ZIP Code'=>'Kod ZIP','My Subscriptions %s'=>'Pajtimet e Mia %s','Chernivtsi Oblast'=>'Provinca e Çernivcit','Potentially unsecured files were found in your uploads directory'=>'Te drejtoria juaj e ngarkimeve u gjetën kartela potencialisht të pasiguruara','Files that may contain %1$sstore analytics%2$s reports were found in your uploads directory - we recommend assessing and deleting any such files.'=>'Kartelat mund të përmbajnë %1$stë dhëna analitike shitoreje%2$s; u gjetën raporte te drejtoria juaj e ngarkimeve - rekomandojmë të shihen dhe të fshihen çfarëdo kartelash të tilla.','Shipping Phone Number'=>'Numër Telefoni Dërgimi','Billing Phone Number'=>'Numër Telefoni Faturimi','Select a product to regenerate the data for, or leave empty for a full table regeneration:'=>'Përzgjidhni një produkt për të cilin të riprodhohen të dhënat, ose lëreni të zbrazët, për riprodhim të plotë të tabelës:','Extension\'s name - this will be used to ensure the data in the request is routed appropriately.'=>'Emri i zgjerimit - ky do të përdoret për të siguruar që të dhënat te kërkesa të drejtohen si duhet.','Page titleRefund and Returns Policy'=>'Rregulla Rimbursimi dhe Kthimi','Enable WooCommerce Analytics'=>'Aktivizoni Analiza WooCommerce-i','Edit page'=>'Përpunoni faqen','%1$s at %2$s %3$s'=>'%1$s më %2$s, %3$s','Product attributes lookup table'=>'Tabelë kërkimi atributesh produkti','Enable table usage'=>'Aktivizo përdorim tabelash','Additional data to pass to the extension'=>'Të dhëna shtesë për t’ia kaluar zgjerimit','Direct updates'=>'Përditësime të drejtpërdrejta','Update the table directly upon product changes, instead of scheduling a deferred update.'=>'Përditësoje tabelën drejtpërsëdrejti, kur ka ndryshime produkti, në vend se të vihet në plan një përditësim i mëvonshëm.','Use the product attributes lookup table for catalog filtering.'=>'Përdor tabelë kërkimesh atributesh produktesh për filtrim katalogu.','These settings are not available while the lookup table regeneration is in progress.'=>'Këto rregullime s’mund të ndryshohen, kur është në ecuri e sipër rikrijimi i tabelës së kërkimeve.','N. Revenue (formatted)'=>'Të ardhura neto (Të formatuara)','Net total revenue (formatted).'=>'Të ardhura neto gjithsej (të formatuara).','When true, refunded items are restocked.'=>'Kur vihet “true”, artikujt e rimbursuar rikthehen në stok.','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.'=>'Kemi krijuar për ju një skicë shembull faqeje Rregulla Rimbursimi dhe Kthimesh. Ju lutemi, hidhini një sy dhe përditësojeni për t’ia përshtatur shitores tuaj.','Page slugrefund_returns'=>'rimbursim_kthime','Setup a Refund and Returns Policy page to boost your store\'s credibility.'=>'Ujdisni një faqe Rregulla Rimbursimesh dhe Kthimesh, për të shtuar besueshmërinë e shitores tuaj.','Limit result set to products that are low or out of stock. (Deprecated)'=>'Kufizoje grupin e përfundimeve te produkte me stok të pakët ose pa stok. (E nxjerrë nga përdorimi)','%1$s could not be served using the Force Download method. A redirect will be used instead.'=>'%1$s s’u shërbye dot duke përdorur metodën Detyro Shkarkim. Në vend të saj do të përdoret një ridrejtim.','%1$s could not be served using the X-Accel-Redirect/X-Sendfile method. A Force Download will be used instead.'=>'%1$s s’u shërbye dot duke përdorur metodën X-Accel-Redirect/X-Sendfile. Në vend të saj do të përdoret Detyro Shkarkim.','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'Nëse është përzgjedhur metoda “Detyro Shkarkime”, apo ajo “X-Accel-Redirect/X-Sendfile”, por s’funksionon, sistemi do të përdorë metodën “Ridrejtoje”, si zgjidhje të fundit. Për më tepër hollësi, <a href="%1$s">shihni këtë udhërrëfyes</a>.','Allow using redirect mode (insecure) as a last resort'=>'Lejo përdorimin e mënyrës ridrejtim (jo e parrezik), si zgjidhje të fundit','Task Options'=>'Mundësi Liste Punësh','Set your store location and where you\'ll ship to.'=>'Ujdisni vendndodhjen e shitores tuaj dhe ku do të dërgoni.','Choose payment providers and enable payment methods at checkout.'=>'Zgjidhni shërbime pagesash dhe aktivizoni metoda pagesash për përfundimin e blerjes.','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Ju ndan vetëm një hap nga marrje pagesash. Verifikoni hollësitë e biznesit tuaj, që të filloni të administroni transaksione përmes WooPayments.','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Fillojani duke shtuar te shitorja juaj produktin tuaj të parë. Produktet tuaja mund t’i shtoni dorazi, përmes CSV-je, ose t’i importoni nga një shërbim tjetër.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Adresa e shitores tuaj është e domosdoshme për të caktuar vendin e origjinës për dërgimin, monedhat dhe mundësitë e pagesave.','Set your store location and configure tax rate settings.'=>'Ujdisni vendndodhjen e shitores tuaj dhe formësoni rregullimet për tarifa tatimi.','Grow your store'=>'Fuqizoni shitoren tuaj','The rate at which tax is applied.'=>'Vlera e zbatuar për taksën.','Notes are unavailable because the "admin-note" data store cannot be loaded.'=>'S’mund të përdoren shënimet, ngaqë s’ngarkohet dot depozitë të dhënash “admin-note”.','Get backups'=>'Merrni kopjeruajtje','Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.'=>'Mosfunksionimi i shitore do të thotë shitje të humbura. Rikthimet me një klikim ju kthejnë në internet pa humbur kohë, nëse diçka shkon ters.','Protect your WooCommerce Store with Jetpack Backup.'=>'Mbroni Shitoren tuaj WooCommerce me Kopjeruajtje Jetpack.','Mollie'=>'Mollie','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Zgjerimi PayFast për WooCommerce ju bën të mundur të pranoni pagesa me kartë krediti dhe EFT përmes njërit prej shërbimeve më popullorë të Afrikës së Jugut për pagesa. Pa tarifa ujdisjeje apo kosto mujore pajtimi.  Përzgjedhja e këtij zgjerimi do të formësojë shitoren tuaj që të përdorë randin e Afrikës së Jugut si monedhë të përzgjedhur.','Number of variation items sold.'=>'Numër artikujsh varianti të shitur.','Variations Sold'=>'Variante të Shitur','Number of product items sold.'=>'Numër artikujsh produkti të shitur.','Products sold'=>'Produkte të Shitur','Source of note.'=>'Burimi i shënimit.','Data store:'=>'Depozitë të dhënash:','This section shows details of Action Scheduler.'=>'Kjo ndarje tregon hollësi Planifikuesi Veprimesh.','Products by Rating list'=>'Listë “Produkte sipas Vlerësimesh”','Recently Viewed Products list'=>'Listë Produktesh të Parë Së Fundi','Change status to cancelled'=>'Ndryshoji gjendjen në “e anuluar”','Download %d ID'=>'ID shkarkimi %d','Things to do next'=>'Gjëra për të bërë më tej','Manage transactions without leaving your WordPress Dashboard. Only with WooPayments.'=>'Administroni transaksione pa dalë nga Pulti juaj i WordPress-it. Vetëm me WooPayments.','Create and send purchase follow-up emails, newsletters, and promotional campaigns straight from your dashboard.'=>'Krijoni dhe dërgoni email-e në vijim të blerjeve, email-e, buletine dhe fushata promocionale drejt e nga pulti juaj.','A link to a product.'=>'Një lidhje për te një produkt.','Product Link'=>'Lidhje Produkti','A link to a product tag.'=>'Një lidhje për te një etiketë produkti.','Product Tag Link'=>'Lidhje Etikete Produkti','A link to a product category.'=>'Një lidhje për te një kategori produkti.','Product Category Link'=>'Lidhje Kategorie Produkti','Invalid path provided.'=>'U dha shteg i pavlefshëm.','How easy was it to add a product tag?'=>'Sa e lehtë qe të shtonit një etiketë produkti?','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'Për të garantuar që njoftimet e shitores tuaj mbërrijnë te ju dhe klientët tuaj, rekomandojmë lidhjen e adresës tuaj email me përkatësinë tuaj dhe ujdisjen e një shërbyesi STMP enkas për këtë punë. Nëse diçka duket se s’po bëhet dërgim i saktë, instaloni shtojcën <a href="%1$s">WP Mail Logging</a>, ose shihni <a href="%2$s">faqen e PBR për Email</a>.','Delta Amacuro'=>'Delta Amakuro','Zulia'=>'Zulia','Yaracuy'=>'Jarakui','Trujillo'=>'Truhijo','Táchira'=>'Taçira','Sucre'=>'Sykrë','Portuguesa'=>'Portugeza','Nueva Esparta'=>'Nueva Esparta','Monagas'=>'Monagas','Miranda'=>'Miranda','Mérida'=>'Merida','Lara'=>'Lara','Guárico'=>'Guariko','Falcón'=>'Falkon','Cojedes'=>'Kohedes','Carabobo'=>'Karabobo','Bolívar'=>'Bolivar','Barinas'=>'Barinas','Aragua'=>'Aragua','Apure'=>'Apure','Anzoátegui'=>'Ancoátegui','Filling in progress (%d)'=>'Plotësim në ecuri e sipër (%d)','Product attributes lookup table data is regenerating'=>'Të d