eni grupin e përfundimeve te produkte bazuar në një çmim minimum, dhënë duke përdorur njësinë më të vogël të monedhës.','The chosen rate ID for the package.'=>'ID tarife të zgjedhur për paketën.','ISO code for the country of the address being shipped to.'=>'Kod ISO për vendin e adresës ku po dërgohet.','Zip or Postcode of the address being shipped to.'=>'Kod Zip ose Postar i adresës ku po dërgohet.','ISO code, or name, for the state, province, or district of the address being shipped to.'=>'Kod ISO, ose emër, për shtetin, provincën, ose distriktin e adresës ku po dërgohet.','City of the address being shipped to.'=>'Qyteti i adresës ku po dërgohet.','Second line of the address being shipped to.'=>'Rresht i dytë adrese ku po dërgohet.','First line of the address being shipped to.'=>'Rreshti i parë i adresës ku po dërgohet.','Quantity left in stock if stock is low, or null if not applicable.'=>'Sasi ende stok, nëse stoku është i ulët, ose <em>null</em>, nëse s’bëhet fjalë për një gjë të tillë.','If true, empty terms will not be returned.'=>'Në qoftë <em>true</em>, termat e zbrazët s’do të jenë pjesë e përgjigjes.','&quot;%s&quot; is not available for purchase.'=>'“%s” s’është i passhëm për blerje.','Invalid coupons were removed from the cart: "%s"'=>'Kuponët e pavlefshëm u hoqën prej shportës: “%s”','The "%1$s" coupon has been removed from your cart: %2$s'=>'Kuponi “%1$s” është hequr nga shporta juaj: %2$s','"%s" has already been applied and cannot be used in conjunction with other coupons.'=>'“%s” është përdorur tashmë dhe s’mund të përdoret tok me kuponë të tjerë.','Coupon code "%s" has already been applied.'=>'Kodi i kuponit “%s” është përdorur tashmë.','"%s" is an invalid coupon code.'=>'“%s” është kod kuponi i pavlefshëm.','The %s payment gateway is not available.'=>'Kanali %s i pagesave s’është i përdorshëm.','Database verified successfully.'=>'Baza e të dhënave u verifikua me sukses.','This tool will empty the template cache.'=>'Ky mjet do të zbrazë fshehtinën e