do','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Merrni njoftime rreth veprimtarisë në shitore, përfshi porosi të reja dhe shqyrtime produktesh, drejt e në pajisjet tuaja celulare, përmes aplikacionit Woo.','Start your online clothing store'=>'Nisni dyqanin tuaj internetor të veshjeve','The admin note layout has a wrong prop value.'=>'Skema e shënimeve të përgjegjësit ka një vlerë të gabuar.','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Ky udhërrëfyes video do t’ju ndihmojë të kaloni nëpër procesin e shtimit të produktit tuaj të parë në WooCommerce.','Do you need help with adding your first product?'=>'Ju duhet ndihmë me shtimin e produktit tuaj të parë?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Të nisësh një sajt mode është ngazëlluese, por mund të duket edhe lodhshme. Në këtë artikull, do t’ju udhëheqim përmes procesit të ujdisjes, do t’ju mësojmë si të krijoni zëra të suksesshëm produktesh, dhe do t’ju tregojmë si të kryeni marketing për publikun tuaj ideal.','Watch tutorial'=>'Shihni përkujdesore','Share feedback'=>'Jepni përshtypje','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Tani që na keni zgjedhur si partner, synimi ynë është të sigurojmë se po ju furnizojmë mjetet e duhura për të plotësuar nevojat. Presim të kemi përshtypjet tuaja mbi pjesën e ujdisjes së shitores, që të mund ta përmirësojmë në të ardhmen.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Ndryshimi i platformave për eTregti mund të duket si pengesë ca e madhe për kapërcim, por kalimi i produkteve, klientëve dhe porosive tuaja në WooCommerce është më i lehtë se sa mund t’ju duket. Ky artikull do t’ju ndihmojë duke ju udhëhequr nëpër këtë proces.','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'Pajtimet WooCommerce ju lejojnë të krijoni një larmi pajtimesh për produkte materiale ose virtuale dhe shërbime. Krijoni klube “Produkti i Muajit”, pajtime mujore shërbimesh, apo paketa vjetore faturimi software-i. Shtoni tarifa regjistrimi, ofroni prova falas, ose caktoni periudha skadimi.','Do you want to migrate from Shopify to WooCommerce?'=>'Doni të migroni nga Shopify në WooCommerce?','Not enough units of %s are available in stock to fulfil this order.'=>'S’ka %s copë të mjaftueshme në stok, për plotësimin e kësaj porosie.','Features'=>'Veçori','Plugins were successfully installed.'=>'Shtojcat u instaluan me sukses.','The requested plugin `%s`. is not yet installed.'=>'Shtojca e domosdoshme `%s`. s’është instaluar ende.','The image of the note, if any.'=>'Figura e shënimit, në pastë.','Visitors'=>'Vizitorë','Views'=>'Parje','Sorry, there is no note with that ID.'=>'Na ndjeni, s’ka shënim me atë ID.','West Pokot'=>'Pokoti Perëndimor','Tana River'=>'Lumi Tana','Homa Bay'=>'Gjiri Homa','Registers whether the note is deleted or not'=>'Regjistron nëse shënimi u fshi apo jo','Plugins must be a non-empty array.'=>'Shtojcat duhet të jenë një varg jo i zbrazët.','Wajir'=>'Uaxhir','Vihiga'=>'Vihiga','Uasin Gishu'=>'Uasin Gishu','Turkana'=>'Turkana','Trans Nzoia'=>'Trans Nzoia','Tharaka-Nithi'=>'Tharaka-Nithi'