lize the homepage that we created for your store during the onboarding.'=>'Faqja hyrëse është një nga pikat më të rëndësishme të hyrjes në shitoren tuaj. Kur është e ndërtuar si duhet, mund të sjellë shndërrime vizitash dhe angazhime më të mëdha. Mos harroni të personalizoni faqen hyrëse që krijuam për shitoren tuaj gjatë procesit të mirëseardhjes.','There was an error communicating with the WooPayments plugin.'=>'Pati një gabim në komunikimin me shtojcën WooPayments.','Securely accept credit and debit cards on your site. Manage transactions without leaving your WordPress dashboard. Only with <strong>WooPayments</strong>.'=>'Pranoni në mënyrë të parrezik në sajtin tuaj karta krediti dhe debiti. Administroni transaksione pa dalë nga pulti i WordPress-it tuaj. Vetëm me <strong>WooPayments</strong>.','Try the new way to get paid'=>'Provoni mënyrën e re për t’u paguar','It appears one or more database tables were missing. Attempting to re-create the missing table(s).'=>'Duket se mungojnë një ose më tepër tabela baze të dhënash. Po provohet të rikrijohet tabela(t) që mungojnë.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Shitorja juaj është formësuar të shërbejë produkte dixhitale duke përdorur metodën “Vetëm ridrejtim”. Kjo metodë është nxjerrë nga përdorimi, <a href="%s">ju lutemi, kaloni në një metodë tjetër.</a><br><em>Nëse për kartela të shkarkueshme përdorni një shërbyes të largët (bie fjala, Google Drive, Dropbox, Amazon S3), mund të donit të “lejonit përdorim ridrejtimesh, si mundësi të fundit”. Aktivizimi i kësaj dhe/ose përzgjedhja e çfarëdo mundësish të tjera, do të sjellë zh