 must accept.'=>'Në daçi, shtoni ndoca tekst për kutizën e kushteve të cilat duhet të pranojnë klientët.','No page set'=>'S’ka faqe të caktuar','Highlight required fields with an asterisk'=>'Nxirri në pah fushat e domosdoshme përmes një yllthi','%s field'=>'Fushë %s','These options let you change the appearance of the WooCommerce checkout.'=>'Këto mundësi ju lejojnë të ndryshoni pamjen e fazës së përfundimit të blerjes në WooCommerce.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Pranojmë pagesa përmes PayPal-it. Kur kryhen pagesa, disa nga të dhënat tuaja do t’i kalohen PayPal-it, përfshi të dhëna të domosdoshme për të kryer ose për të mund të kryer pagesën, të tilla si shuma e blerjes dhe të dhëna faturimi.','%s page'=>'Faqe %s','I have read and agree to the website %s'=>'I kam lexuar dhe pajtohem me %s e sajtit','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Merrni personalisht pagesa përmes BACS. Rëndom i njohur më tepër si mandatpagesë.','Any &quot;%1$s&quot; method'=>'Çfarëdo metode “%1$s”','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'Në këtë nënndarje duhet të radhitni cilët përpunues pagesash palë të treta përdorni për të pranuar pagesa në shitoren tuaj, ngaqë këta mund të trajtojnë të dhëna klienti. Si shembull, kemi përfshirë PayPal-in, por do të duhej ta hiqnit, nëse nuk përdorni PayPal-in.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Ndajmë të dhëna me palë të treta që na ndihmojnë t’ju furnizojmë porositë tona dhe shërbime shitoreje; për shembull --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'Në këtë ndarje duhet të radhitni me kë ndani të dhëna, dhe për ç’qëllim. Kjo mund të përfshinte, por pa u kufizuar me kaq, analiza, marketing, kanale pagesash, shërbime dërgimesh, dhe trupëzime palësh të treta.','What we share with others'=>'Çka ndajmë me të tjerë','Customer information like your name, email address, and billing and shipping information.'=>'Të dhëna klienti, të tilla si emri juaj, adresa email, dhe të dhëna faturimi dhe dërgimi.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Të dhëna porosie, të tilla si ç’bletë, kur u ble dhe ku duhet dërguar, dhe','Who on our team has access'=>'Cilët prej ekipit tonë mund t’i përdorin','We will also store comments or reviews, if you choose to leave them.'=>'Do të depozitojmë edhe komente ose shqyrtime, nëse vendosni të bëni të tilla.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Përgjithësisht depozitojmë të dhëna rreth jush për aq sa na duhet për qëllimet për të cilat i grumbullojmë dhe i përdorim, dhe s’jemi të detyruar ligjërisht të vazhdojmë mbajtjen e tyre. Për shembull, do të depozitojmë të dhëna për XXX vjet, për qëllime tatimi dhe kontabiliteti. Këtu përfshihet emri juaj, adresa email dhe të adresa faturimi dhe dërgimi.','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Anëtarët e ekipit tonë mund të hyjnë në këto të dhëna, si ndihmë për përmbushjen e porosive, kryerje rimbursimesh dhe asistencë për ju.','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Anëtarët e ekipit tonë mund të hyjnë në të dhënat që na furnizoni. Për shembull, si Administratorët, ashtu edhe Përgjegjësit e Shitores mund të hyjnë në:','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Nëse krijoni një llogari, do të depozitojmë emrin tuaj, adresën, email-in dhe numrin e telefonit, të cilat do të përdoren për të plotësuar hapin e përfundimit të blerjes gjatë porosish të ardhshme.','Send you marketing messages, if you choose to receive them'=>'Do t’ju dërgojmë mesazhe marketingu, nëse zgjidhni të merrni të tillë','Comply with any legal obligations we have, such as calculating taxes'=>'Përputhshmëri me çfarëdo detyrimesh ligjore që kemi, bie fjala, përllogaritje taksash','Set up your account for our store'=>'Ujdisje të llogarisë tuaj për shitoren tonë','Respond to your requests, including refunds and complaints'=>'Përgjigje kërkesave tuaja, përfshi rimbursime dhe ankesa','Send you information about your account and order'=>'Dërgim të dhënash rreth llogarisë dhe porosisë tuaj','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Kur blini prej nesh, do t’ju kërkojmë të na jepni të dhëna ku përfshihen emri juaj, adresë faturimi, adresë dërgimi, adresë email, numër telefoni, hollësi karte krediti/pagese dhe të dhëna opsionale llogarie, të tilla si emër përdoruesi dhe fjalëkalim. Këto të dhëna do t’i përdorim për qëllime të tilla si:','Process payments and prevent fraud'=>'Përpunim pagesash dhe parandalim mashtrimesh','Improve our store offerings'=>'Të përmirësojmë ç’ofron shitorja jonë','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Shënim: mund të doni të jepni më tepër hollësi rreth trajtimit tuaj të cookie-ve, dhe të jepni këtu një lidhje për te ajo ndarje.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Ne do të përdorim gjithashtu <em>cookies</em> për të ndjekur lëndë shportash, teksa shfletoni në sajtin tonë.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Adresë dërgimesh: do t’ju kërkojmë ta jepni këtë që të mundim, për shembull, të japim një vlerë të përafërt të dërgimit, përpara se të përfundoni një porosi, dhe për t’jua dërguar porosinë!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Vendndodhje, adresë IP dhe lloj shfletuesi: këto do t’i përdorim për qëllime të tilla si përllogaritja përafërsisht e taksave dhe vlerës së dërgimit','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Produkte që keni parë:  këto do t’i përdorim, për shembull, për t’ju shfaqur produkte që keni parë së fundi','While you visit our site, we’ll track:'=>'Teksa vizitoni sajtin tonë, do të ndjekim:','What we collect and store'=>'Çka mbledhim dhe depozitojmë','We collect information about you during the checkout process on our store.'=>'Grumbullojmë rreth jush të dhëna gjatë procesit të përfundimit të blerjes në shitoren tonë.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Ky shembull përfshin të dhëna bazë rreth çfarë të dhënash personale mund të grumbullojë shitorja juaj, ç’depoziton dhe ç’u jep të tjerëve, si dhe se cilët mund të hyjnë në këto të dhëna. Informacioni specifik që shitorja juaj u jep të tjerëve do të varet nga rregullimet që janë aktivizuar dhe shtojca shtesë që përdoren. Rekomandojmë të këshilloheni me një jurist, kur të vendosni se ç’informacion të jepni te rregullat tuaja të privatësisë.','User email'=>'Email i përdoruesit','Download count'=>'Numër shkarkimesh','Browser User Agent'=>'Agjent Përdoruesi i Shfletuesit','Order Number'=>'Numër Porosie','Access granted'=>'U akordua hyrje','Items Purchased'=>'Artikuj të Blerë','Token'=>'Token','Payment Tokens'=>'Token-ë Pagesash','optional'=>'opsionale','Phone Number'=>'Numër Telefoni','Billing State'=>'Shtet Faturimi','Billing City'=>'Qytet Faturimi','Billing Last Name'=>'Mbiemër Faturimi','Billing First Name'=>'Emër Faturimi','Update status event failed.'=>'Dështoi akti i përditësimit të gjendjes.','Download ID'=>'ID Shkarkimi','Shipping State'=>'Shtet Dërgimi','Shipping Postal/Zip Code'=>'Kod Zip/Postar Dërgimi','Shipping City'=>'Qytet Dërgimi','Shipping Last Name'=>'Mbiemër Dërgimi','Shipping First Name'=>'Emër Dërgimi','Billing Postal/Zip Code'=>'Kod Zip/Postar Faturimi','Display name'=>'Emër në ekran','display name%1$s %2$s'=>'%1$s %2$s','Unable to create order.'=>'S’arrihet të krijohet porosia.','Cloning is forbidden.'=>'Ndalohet klonimi.','If the payment was refunded via the API.'=>'Nëse pagesa qe rimbursuar përmes API-t.','Name of the customer for the order'=>'Emër i klientit për porosinë','Access to Purchased Downloads'=>'Hyrje te Shkarkime të Blera','Purchased Downloads'=>'Shkarkime të Blera','Customer Data'=>'Të dhëna Klienti','Personal data removed.'=>'U hoqën të dhëna personale.','Removed access to downloadable files.'=>'U hoq hyrje te kartela të shkarkueshme.','Removed personal data from order %s.'=>'U hoqën të dhëna personale prej porosisë %s.','Shipping Company'=>'Shoqëri Dërgimi','Billing Company'=>'Shoqëri Faturimi','Error during status transition.'=>'Gabim gjatë tranzicioni gjendjeje.','Payment complete event failed.'=>'Dështoi akt plotësimi pagese.','User roleShop manager'=>'Përgjegjës shitoreje','User roleCustomer'=>'Klient','Display name cannot be changed to email address due to privacy concern.'=>'Për shkak anësh sigurie, emri në ekran s’mund të ndryshohet në adresë email.','Please read and accept the terms and conditions to proceed with your order.'=>'Ju lutemi, që të vazhdohet me porosinë tuaj, lexoni dhe pranoni termat dhe kushtet.','Deleted all active sessions, and %d saved carts.'=>'U fshinë krejt sesionet aktive dhe %d shporta të ruajtura.','%d permissions deleted'=>'U fshinë %d leje','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'Ky mjet do të fshijë nga baza e të dhënave krejt të dhënat e sesionit të klientëve, përfshi shporta të tanishme dhe shporta të ruajtura në bazën e të dhënave.','Clean up download permissions'=>'Spastro leje shkarkimesh','Used-up download permissions'=>'Leje të përdorura shkarkimesh','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Kufizoje grupin e përfundimeve me një atribut të dhënë. Përdorni emër klasifikimi/identifikues atributi.','Order total formatted for locale'=>'Shumë porosie, e formatuar për vendoren','URL to edit the order'=>'URL për përpunim të porosisë','Blog id of the record on the multisite.'=>'ID blogu i zërit te shumësajtëshi.','Unserializing instances of this class is forbidden.'=>'Heqja e serializimit për instanca të kësaj klase është e ndaluar.','Customer download permissions have been retained.'=>'Lejet e shkarkimit për klientin janë mbajtur.','Personal data within order %s has been retained.'=>'Të dhënat personale brenda porosisë %s janë mbajtur.','%1$s has been removed from your cart because it has since been modified. You can add it back 