me llogarie','Secure checkout'=>'Përfundim blerjeje i parrezik','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Porositë e anuluara janë të papaguara dhe mund të jenë anuluar nga i zoti i shitore ose klienti. Do të shpihen te hedhurinat pas kohëzgjatjes së caktuar.','Retain cancelled orders'=>'Mbaji porositë e anuluara','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Porositë e dështuara janë të papaguara dhe mund të jenë braktisur nga klienti. Do të shpihen te hedhurinat pas kohëzgjatjes së caktuar.','Retain failed orders'=>'Mbaji porositë e dështuara','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Porositë pezull janë të papaguara dhe mund të jenë braktisur nga klienti. Do të shpihen te hedhurinat pas kohëzgjatjes së caktuar.','Retain completed orders'=>'Mbaji porositë e plotësuara','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Mbajini porositë e plotësuara, për një kohë të caktuar, përpara se t’i shndërroni në anonime të dhënat personale brenda tyre.','Enable tax rates and calculations'=>'Aktivizo tarifa tatimi dhe llogaritje','Account erasure requests'=>'Kërkesë fshirjeje llogarie','Accounts &amp; Privacy'=>'Llogari &amp; Privatësi','Allowed emails'=>'Email-e të lejuar','Remove personal data'=>'Hiq të dhëna personale','Retain pending orders '=>'Mbaji porositë pezull ','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Llogari joaktive janë ato në të cilat s’është bërë hyrje, ose s’është bërë ndonjë porosi prej tyre, gjatë kohës së caktuar. Do të fshihen. Çfarëdo porosie do të shndërrohet në porosi mysafirësh.','Retain inactive accounts '=>'Mbaji llogaritë joaktive ','Personal data retention'=>'Mbajtje të dhënash personale','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Të dhënat tuaja personale do të përdoren për të përpunuar porosinë tuaj, për të mbuluar funksionimin e këtij sajti për ju, dhe për qëllime të tjera të përshkruara te %s jonë.','Optionally add some text about your store privacy policy to show during checkout.'=>'Shtoni, në daçi, ndoca tekst rreth rregullave të privatësisë në shitoren tuaj, për ta shfaqur gjatë fazës së përfundimit të blerjes.','Checkout privacy policy'=>'Rregulla privatësie për fazën e përfundimit të blerjes','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Të dhënat tuaja personale do të përdoren për të mbuluar funksionimin e këtij sajti për ju, për administrimin e hyrjeve në llogarinë tuaj, dhe për qëllime të tjera të përshkruara te %s jonë.','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Shtoni, në daçi, ndoca tekst rreth rregullave të privatësisë në shitoren tuaj, për ta shfaqur në formularë regjistrimin llogarish.','Registration privacy policy'=>'Rregulla privatësie regjistrimi','Privacy policy'=>'Rregulla privatësie','Filter by registered customer'=>'Filtroji sipas klienti të regjistruar','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Zgjidhni për sa kohë të mbahen të dhënat personale, kur nuk duhen më për kryerjen e porosive. Për t’i mbajtur pafundësisht të dhënat, lërini të zbrazëta fushat vijuese.','Use previous column mapping preferences?'=>'Të përdoren parapëlqime përshoqërimi të shtyllës së mëparshme?','This section controls the display of your website privacy policy. The privacy