të anashkalohen.','M j, Y'=>'j.m.Y','The WooCommerce Helper plugin is no longer needed. <a href="%s">Manage subscriptions</a> from the extensions tab instead.'=>'Shtojca WooCommerce Helper s’nevojitet më. Në vend të saj, <a href="%s">administrojini pajtimet</a> që nga skeda e zgjerimeve.','Reasons you\'ll love Jetpack'=>'Arsye pse do ta doni Jetpack-un','Continue with Jetpack'=>'Vazhdoni me Jetpack-un','payment setup'=>'ujdisje pagesash','payment setup and automated taxes'=>'ujdisje pagesash dhe taksa të automatizuara','Webhook topic unknown. Please select a valid topic.'=>'Subjekt i panjohur për webhook-e. Ju lutemi, përzgjidhni një subjekt të vlefshëm.','Delete "%s" permanently'=>'Fshije “%s” përgjithmonë','Direct payments to email address:'=>'Pagesa të drejtpërdrejta te adresë email:','Email address to receive payments'=>'Adresë email për marrje pagesash','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place. <a href="%s" target="_blank">Learn more about Square</a>.'=>'Pranoni pa rrezik karta krediti dhe debiti me një përqindje të ulët, pa tarifa surprizë (mund të kihen përqindje vetjake). Shisni në internet dhe në shitoren fizike dhe ndiqni shitjet dhe depon që nga një vend. <a href="%s" target="_blank">Mësoni më tepër rreth Square-it</a>.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Zgjidhni pagesën që doni, paguani tani, paguani më vonë ose me pjesë. Pa numra kartash krediti, pa fjalëkalime, pa kokëçarje. <a href="%s" target="_blank">Mësoni më tepër rreth Klarna-s</a>.','Square'=>'Square','Klarna Payments'=>'Pagesa Klarna','Klarna Checkout'=>'Përfundim blerjeje me Klarna','Full checkout experience with pay now, pay later and slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Përfundim i plotë i blerjes, me pagim tani, pagim më vonë ose me pjesë. Pa numra kartash krediti, pa fjalëkalime, pa kokëçarje. <a href="%s" target="_blank">Mësoni më tepër rreth Klarna-s</a>.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay. <a href="%s" target="_blank">Learn more</a>.'=>'Pranoni karta debiti dhe krediti në 135+ monedha, metoda të tilla si Alipay, dhe përfundim blerje me një prekje, përmes Apple Pay-it. <a href="%s" target="_blank">Mësoni më tepër</a>.','I will also be selling products or services in person.'=>'Do të shes produkte ose shërbime në rrugën klasike.','Customer downloads'=>'Shkarkime klienti','Revision restored.'=>'Rishikimi u kthye.','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop</code> would make your product links like <code>%sshop/sample-product/</code>. This setting affects product URLs only, not things such as product categories.'=>'Nëse doni, mund të jepni këtu struktura vetjake për URL-të tuaja të produkteve. Për shembull, duke përdorur <code>shop</code> do t’i bënte lidhjet tuaja të produkte të ngjashme me <code>%sshop/sample-product/</code>. Ky rregullim prek vetëm URL produktesh, dhe jo gjëra të tilla si kategori produktesh.','Dar es Salaam'=>'Dar es Salam','Move &#8220;%s&#8221; to the Trash'=>'Shpjere &#8220;%s&#8221; te Hedhurinat','Determines how this attribute\'s values are displayed.'=>'Përcakton se si shfaqen vlerat e këtij atributi.','This product has produced sales and may be linked to existing orders. Are you sure you want to delete it?'=>'Ky produkt ka prodhuar shitje dhe mund të jetë i lidhur me porosi ekzistuese. Jeni i sigurt se doni të fshihet?','Katavi'=>'Katavi','Geita'=>'Geita','Tanga'=>'Tanga','Tabora'=>'Tabora','Singida'=>'Singida','Ruvuma'=>'Ruvuma','Rukwa'=>'Rukua','Morogoro'=>'Morogoro','Zanzibar West'=>'Zanzibari Perëndimor','Mara'=>'Mara','Lindi'=>'Lin