ar klasën %s - Email-et HTML/Me Disa Pjesë, dhe edhe disa zgjerime, s’do të funksionojnë pa DOMDocument.','HTML/Multipart emails use DOMDocument to generate inline CSS in templates.'=>'Email-et HTML/Me Disa Pjesë përdorin DOMDocument për të prodhuar CSS të brendshme në gjedhet.','Some webservices like shipping use SOAP to get information from remote servers, for example, live shipping quotes from FedEx require SOAP to be installed.'=>'Disa shërbime web, bie fjala ato për dërgime, e përdorin SOAP-in për të marrë të dhëna nga shërbyes të largët, për shembull, tarifat e drejtpërdrejta të dërgimit nga FedEx duan SOAP-in që të instalohen.','Payment gateways can use cURL to communicate with remote servers to authorize payments, other plugins may also use it when communicating with remote services.'=>'Kanale pagesash mund ta përdorin cURL-në për të komunikuar me shërbyes të largët për të autorizuar pagesa, mund ta përdorin edhe shtojca të tjera, kur komunikojnë me shërbime të largët.','The largest filesize that can be uploaded to your WordPress installation.'=>'Madhësia më e madhe për kartela që mund të ngarkohen në instalimin tuaj të WordPress-it.','The maximum number of variables your server can use for a single function to avoid overloads.'=>'Numri maksimum i ndryshoreve që shërbyesi juaj mund të përdorë për një funksion të vetëm, për të shmangur mbingarkesa.','The amount of time (in seconds) that your site will spend on a single operation before timing out (to avoid server lockups)'=>'Sasia e kohës (në sekonda) që sajti juaj do të shpenzojë në një veprim të vetëm, përpara mbarimit të kohës (për të shmangur bllokime shërbyesi)','The largest filesize that can be contained in one post.'=>'Madhësia më e madhe e kartelave që mund të përmbahen në një postim.','Information about the web server that is currently hosting your site.'=>'Të dhëna mbi shërbyesin që strehon aktualisht sajtin tuaj.','The current language used by WordPress. Default = English'=>'Gjuha e përdorur aktualisht nga WordPress-i. Parazgjedhje = Anglisht','The maximum amount of memory (RAM) that your site can use at one time.'=>'Sasia maksimum e kujtesës (RAM) që sajti juaj mund të përdorë në një çast.','Suhosin is an advanced protection system for PHP installations. It was designed to protect your servers on the one hand against a number of well known problems in PHP applications and on the other hand against potential unknown vulnerabilities within these applications or the PHP core itself. If enabled on your server, Suhosin may need to be configured to increase its data submission limits.'=>'Suhosin është një sistem e përparuar mbrojtjeje për instalime PHP. Qe konceptuar për të mbrojtur shërbyesit tuaj, nga njëra anë kundër një numri problemesh të njohur mirë në aplikacione PHP dhe, në anën tjetër kundër cenueshmërish të panjohura potenciale brenda këtyre aplikacione ose vetë bazës së PHP-së. Nësse aktivizohet në shërbyesin tuaj, Suhosin mund të dojë formësim që të rriten kufij parashtrimi të dhënash.','Several WooCommerce extensions can write logs which makes debugging problems easier. The directory must be writable for this to happen.'=>'Disa zgjerime WooCommerce mund të shkruajnë regjistra të cilët e bëjnë më të lehtë diagnostikimin e problemeve. Që të ndodhë kjo, drejtoria duhet të jetë e shkrueshme.','What currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Në ç’monedhë tregohen çmimet te katalogu dhe në cilat monedha do të pranojnë pagesa kanalet.','Page does not contain the %s shortcode.'=>'Faqja s’përmban kodin e shkurtër %s.','If you are modifying WooCommerce on a parent theme that you did not build personally we recommend using a child theme. See: <a href="%s" target="_blank">How to create a child theme</a>'=>'Nëse po e ndryshoni WooCommerce në një temë mëmë që s’e montuat ju personalisht, këshillojmë përdorimin e një teme pjellë. Shihni: <a href="%s" target="_blank">Si të krijohet një temë pjellë</a>','Table do