=>'Njësi Mbajtjeje Gjendje','Exclude sale items'=>'Artikuj të përjashtuar nga shitja','This field allows you to set the minimum spend (subtotal) allowed to use the coupon.'=>'Kjo fushë ju lejon të caktoni maksimumin e shpenzuar (nënshumë) të lejuar kur përdorni kuponin.','Terms successfully recounted'=>'Termat u rinumëruan me sukses','Stock quantity. If this is a variable product this value will be used to control stock for all variations, unless you define stock at variation level.'=>'Sasi gjendje. Nëse ky është një produkt i ndryshueshëm, kjo vlerë do të përdoret për të kontrolluar gjendjen e krejt varianteve, veç në përcaktofshi gjendje në shkallë varianti.','Define whether or not the entire product is taxable, or just the cost of shipping it.'=>'Përcaktoni nëse është apo jo i tatueshëm krejt produkti, apo vetëm kostoja e dërgimit për të.','Enter the number of days before a download link expires, or leave blank.'=>'Jepni numrin e ditëve përpara se të skadojë një lidhje shkarkimesh, ose lëreni të zbrazët.','This is the URL or absolute path to the file which customers will get access to. URLs entered here should already be encoded.'=>'Kjo është URL-ja ose shtegu absolut për te kartela te e cila përdoruesi to të përfitojë hyrje. URL-të e dhëna këtu duhet të jenë të koduara tashmë.','SKU refers to a Stock-keeping unit, a unique identifier for each distinct product and service that can be purchased.'=>'SKU do të thotë “Stock Keeping Unit” - e përkthyer fjalë për fjalë si “Njësi Mbajtjeje Gjendje”, një identifikues unik për çdo produkt dhe shërbim i cili mund të blihet.','Downloadable products give access to a file upon purchase.'=>'Produktet e shkarkueshëm japin hyrje te një kartel, me blerjen.','Add a note for your reference, or add a customer note (the user will be notified).'=>'Shtoni një shënim si referencë për veten, ose shtoni një shënim klienti (përdoruesi do të njoftohet).','Coupon code already exists - customers will use the latest coupon with this code.'=>'Kodi i kuponit ekziston tashmë - klientët do të përdorin kuponin më të ri me këtë kod.','The maximum number of individual items this coupon can apply to when using product discounts. Leave blank to apply to all qualifying items in cart.'=>'Numri maksimum i artikujve individualë mbi të cilën mund të aplikohet ky kupon kur përdoren zbritje në çmime produktesh. Lëreni të zbrazët që të aplikohet mbi krejt artikujt e shportës mbi të cilët ka vend.','Check this box if the coupon should not apply to items on sale. Per-item coupons will only work if the item is not on sale. Per-cart coupons will only work if there are items in the cart that are not on sale.'=>'I vini shenjë kësaj kutize, nëse kuponi s’duhet aplikuar mbi artikuj me ulje çmimi. Kuponët për një artikull do të funksionojnë vetëm nëse artikulli s’është me ulje çmimi. Kuponët për një shportë do të funksionojnë vetëm nëse te shporta ka artikuj që s’janë me ulje çmimi.','Check this box if the coupon cannot be used in conjunction with other coupons.'=>'I vini shenjë kësaj kutize, nëse kuponi s’mund të përdoret tok me kuponë të tjerë.','Attribute terms can be assigned to products and variations.<br/><br/><b>Note</b>: Deleting a term will remove it from all products and variations to which it has been assigned. Recreating a term will not automatically assign it back to products.'=>'Terma atributesh mund t’u caktohen produkteve dhe varianteve.<br/><br/><b>Shënim</b>: Fshirja e një termi do ta heq prej krejt produkteve dhe varianteve të cilëve u është caktuar. Rikrijimi i termit s’do të sjellë ricaktim të automatizuar te produktet.','This tool will reset the admin, customer and shop_manager roles to default. Use this if your users cannot access all of the WooCommerce admin pages.'=>'Ky mjet do të kthejë te parazgjedhjet rolet përgjegjës, klient dhe përgjegjës_shitoreje. Përdoreni këtë nëse përdoruesit tuaj nuk hyjnë dot në krejt faqet e administrimit të WooCommerce-it.','Reset capabilities'=>'Rikthe aftësitë te parazgjedhjet','This tool will recount product terms - useful when changing your settings in a way which hides products from the catalog.'=>'Ky mjet do të bëjë rinumërim të termave të produkteve - e dobishme kur ndryshoni rregullimet tuaja në një mënyrë që fsheh produkte prej katalogut.','This tool will clear ALL expired transients from WordPress.'=>'Ky mjet do të spastrojë KREJT tranzientët prej WordPress-i.','Expired transients'=>'Tranzientë të skaduar','This tool will clear the product/shop transients cache.'=>'Ky mjet do të spastrojë fshehtinën e tranzientëve të produkteve/shitores.','Clear transients'=>'Spastroji tranzientët','%d transients rows cleared'=>'U spastruan %d rreshta tranzientësh','Product transients cleared'=>'U spastruan tranzientë produktesh','Choose a tax class for this product. Tax classes are used to apply different tax rates specific to certain types of product.'=>'Zgjidhni një klasë taksash për këtë produkt. Klasat e taksave përdoren për të aplikuar tarifa të ndryshme tatimi për lloje të dhënë produktesh.','Check this box if the coupon grants free shipping. A <a href="%s" target="_blank">free shipping method</a> must be enabled in your shipping zone and be set to require "a valid free shipping coupon" (see the "Free Shipping Requires" setting).'=>'I vini shenjë kësaj kutize, nëse kuponi akordon dërgim falas. Te zona juaj e dërgimeve duhet të jetë aktivizuar <a href="%s" target="_blank">një metodë dërgimesh falas</a> dhe ujdisur që të kërkojë doemos “një kupon të vlefshëm dërgimi falas” (shihni rregullimin “Dërgimi Falas Lyp”).','Import tax rates'=>'Importoni tarifa tatimi','View tax rates'=>'Shihni tarifa tatimi','Product categories for your store can be managed here. To change the order of categories on the front-end you can drag and drop to sort them. To see more categories listed click the "screen options" link at the top-right of this page.'=>'Kategori produktesh për shitoren tuaj mund të administrohen që këtu. Që të ndryshoni rendin e kategorive